import React from "react";
import Card from "./Card";
import ExpenceItem from "./ExpenceItem";

import "./Expences.css";

const Expences = ({ expenses }) => {
  return (
    <Card className="expenses">
      {expenses.map((expence) => (
        <ExpenceItem
          key={expence.id}
          title={expence.title}
          amount={expence.amount}
          date={expence.date}
        />
      ))}
    </Card>
  );
};

export default Expences;
